import React from 'react';
import ReactDOM from 'react-dom';
import MUIDataTable from 'mui-datatables';
import Done from '@material-ui/icons/Done';
import Error from '@material-ui/icons/Error';
import Tooltip from '@material-ui/core/Tooltip';
import IconButton from '@material-ui/core/IconButton';
import Menu from '@material-ui/core/Menu';
import MenuItem from '@material-ui/core/MenuItem';
import MoreVertIcon from '@material-ui/icons/MoreVert';
import Button from '@material-ui/core/Button';

const AppUsersForms = () => {
  const columns = [
    { name: 'Deployment ID' },
    { name: 'Application' },
    'Configuration',
    'Version ',
    'Last Deployed',
    'Approval',
    'Operation',
    {
      name: 'Health',
      options: {
        customBodyRender: (value, tableMeta, updateValue) => {
          if (value === 'OK')
            return (
              <Tooltip title="OK">
                <Done color="primary" />
              </Tooltip>
            );
          else
            return (
              <Tooltip title="Failing">
                <Error color="error" />
              </Tooltip>
            );
        },
      },
    },
    {
      name: 'Actions',
      options: {
        customBodyRender: (value, tableMeta, updateValue) => {
          return (
            <Button variant="outlined" color="secondary">
              {`Review`}
            </Button>
          );
        },
      },
    },
  ];

  const data = [
    [
      '78r9-2d34-asd2342fxsdfs3',
      'kelaForecast',
      'Production',
      1.5,
      '10/28/2018',
      'Approved',
      'Complete',
      'OK',
      '',
    ],
    [
      '78r9-2d34-asd2342fxsdfs3',
      'kelaForecast',
      'Test',
      1.5,
      '10/28/2018',
      'New Version Pending',
      'Error',
      'Failing',
      'Bad',
    ],
    [
      '78r9-2d34-asd2342fxsdfs3',
      'InnerVision',
      'Production',
      2.0,
      '10/31/2018',
      'Approved',
      'Complete',
      'OK',
      '',
    ],
    [
      '78r9-2d34-asd2342fxsdfs3',
      'InnerVision',
      'Test',
      2.1,
      '10/31/2018',
      'Approved',
      'In Progress',
      'OK',
      '',
    ],
    [
      '78r9-2d34-asd2342fxsdfs3',
      'OncoKnowledge',
      'Production',
      1.0,
      '10/29/2018',
      'Approved',
      'Complete',
      'OK',
      '',
    ],
    [
      '78r9-2d34-asd2342fxsdfs3',
      'OncoKnowledge',
      'Test',
      1.12,
      '10/28/2018',
      'New Version Pending',
      'Error',
      'Failing',
      'Bad',
    ],
  ];

  const options = {
    filterType: 'dropdown',
    responsive: 'scroll',
    selectableRows: true,
  };

  return <MUIDataTable title={'Deployments'} data={data} columns={columns} options={options} />;
};

export default AppUsersForms;
